import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { 
  HomeIcon, 
  ChartBarIcon, 
  ArrowTrendingUpIcon,
  FunnelIcon,
  DocumentArrowDownIcon,
  SparklesIcon,
  BoltIcon
} from '@heroicons/react/24/outline';

// Import components
import Header from './components/Header';

// Import pages
import Scraper from './pages/Scraper';
import DataCleaning from './pages/DataCleaning';
import EDA from './pages/EDA';
import Predictions from './pages/Predictions';
import Export from './pages/Export';
import AICoach from './pages/AICoach';
import MomentumEngine from './pages/MomentumEngine';

function App() {
  const [activeModule, setActiveModule] = useState(null);

  const modules = [
    {
      id: 'scraper',
      name: 'Data Scraping',
      description: 'Collect cricket data from various sources',
      icon: HomeIcon,
      color: 'from-blue-500 to-blue-600',
      status: 'ready'
    },
    {
      id: 'cleaning',
      name: 'Data Cleaning',
      description: 'Process and clean raw cricket data',
      icon: FunnelIcon,
      color: 'from-green-500 to-green-600',
      status: 'ready'
    },
    {
      id: 'eda',
      name: 'Exploratory Analysis',
      description: 'Analyze and visualize cricket data',
      icon: ChartBarIcon,
      color: 'from-purple-500 to-purple-600',
      status: 'ready'
    },
    {
      id: 'predictions',
      name: 'ML Predictions',
      description: 'AI-powered cricket predictions',
      icon: ArrowTrendingUpIcon,
      color: 'from-orange-500 to-orange-600',
      status: 'ready'
    },
    {
      id: 'export',
      name: 'Export to Power BI',
      description: 'Export data for Power BI analysis',
      icon: DocumentArrowDownIcon,
      color: 'from-indigo-500 to-indigo-600',
      status: 'ready'
    },
    {
      id: 'ai-coach',
      name: 'AI Strategy Coach',
      description: 'Get AI-powered cricket strategies',
      icon: SparklesIcon,
      color: 'from-pink-500 to-pink-600',
      status: 'ready'
    },
    {
      id: 'momentum',
      name: 'Momentum Engine',
      description: 'Real-time game momentum tracking',
      icon: BoltIcon,
      color: 'from-red-500 to-red-600',
      status: 'ready'
    }
  ];

  const handleModuleClick = (moduleId) => {
    setActiveModule(moduleId);
    console.log(`Module clicked: ${moduleId}`);
  };

  const getStatusColor = (status) => {
    switch(status) {
      case 'ready': return 'bg-green-100 text-green-800';
      case 'processing': return 'bg-yellow-100 text-yellow-800';
      case 'error': return 'bg-red-100 text-red-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  const renderModulePage = () => {
    switch(activeModule) {
      case 'scraper': return <Scraper />;
      case 'cleaning': return <DataCleaning />;
      case 'eda': return <EDA />;
      case 'predictions': return <Predictions />;
      case 'export': return <Export />;
      case 'ai-coach': return <AICoach />;
      case 'momentum': return <MomentumEngine />;
      default: return null;
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {!activeModule ? (
        <>
          <Header />

          {/* Hero Section */}
          <div className="bg-gradient-to-r from-blue-600 to-indigo-700 text-white py-16">
            <div className="container mx-auto px-4">
              <div className="text-center">
                <h1 className="text-5xl font-bold mb-4">Cricket Analytics Platform</h1>
                <p className="text-xl opacity-90">Complete data pipeline for cricket analytics and insights</p>
              </div>
            </div>
          </div>

          {/* Main Content */}
          <div className="container mx-auto px-4 py-12">
